import React from "react";
import { motion } from "framer-motion";
import { IoBookOutline, IoBriefcaseOutline } from "react-icons/io5";

const Resume = () => {
  const education = [
    {
      title: "Shri Rama Bharti Public School",
      period: "2016 — 2017",
      description: "CLASS-X",
    },
    {
      title: "Shri Rama Bharti Public School",
      period: "2018 — 2019",
      description: "CLASS-XII",
    },
    {
      title: "Amity University",
      period: "2020 — 2024",
      description: "B.Tech In Computer Science And Engineering",
    },
  ];

  const experience = [
    {
      title: "Zidio",
      period: "Aug, 2024 — Present",
      description: "Working as a full stack web developer",
    },
    {
      title: "Apex Biomedicals",
      period: "May, 2024 - July, 2024",
      description: "Worked as a frontend developer",
    },
    {
      title: "Academor",
      period: "Mar, 2023 - Apr, 2023",
      description: "Gained hands-on experience on basic cloud operations.",
    },
  ];

  const skills = [
    "HTML",
    "CSS",
    "JavaScript",
    "React",
    "Node.js",
    "TypeScript",
    "MongoDB",
    "Express.js",
    "Tailwind CSS",
    "Git",
    "Netlify",
    "Vercel",
    "AWS",
    "Docker",
  ];

  return (
    <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className="max-w-4xl mx-auto p-6 bg-gray-800 rounded-xl shadow-2xl"
        >
          <header className="mb-10">
            <h2 className="text-4xl font-bold text-white tracking-tight">
              Resume
            </h2>
          </header>

          {/* Education Section */}
          <section className="mb-12">
            <div className="flex items-center mb-8">
              <motion.div
                className="w-14 h-14 bg-gradient-to-r from-orange-400 to-yellow-500 rounded-xl flex items-center justify-center mr-4 shadow-md hover:shadow-lg transition-shadow duration-300"
                whileHover={{ scale: 1.1 }}
              >
                <IoBookOutline className="text-black text-2xl" />
              </motion.div>
              <h3 className="text-2xl font-semibold text-white">Education</h3>
            </div>

            <div className="space-y-8">
              {education.map((item, index) => (
                <motion.div
                  key={index}
                  initial={{ opacity: 0, x: -20 }}
                  animate={{ opacity: 1, x: 0 }}
                  transition={{ duration: 0.5, delay: index * 0.1 }}
                  className="relative pl-10 border-l-2 border-orange-400 hover:border-orange-300 transition-colors duration-300"
                >
                  <motion.div
                    className="absolute -left-3 top-0 w-6 h-6 bg-orange-400 rounded-full"
                    whileHover={{ scale: 1.2 }}
                  ></motion.div>
                  <h4 className="text-xl font-semibold text-white mb-2 hover:text-orange-300 transition-colors duration-300">
                    {item.title}
                  </h4>
                  <span className="text-base text-orange-400 mb-2 block font-medium">
                    {item.period}
                  </span>
                  <p className="text-base text-gray-300">{item.description}</p>
                </motion.div>
              ))}
            </div>
          </section>

          {/* Experience Section */}
          <section className="mb-12">
            <div className="flex items-center mb-8">
              <motion.div
                className="w-14 h-14 bg-gradient-to-r from-orange-400 to-yellow-500 rounded-xl flex items-center justify-center mr-4 shadow-md hover:shadow-lg transition-shadow duration-300"
                whileHover={{ scale: 1.1 }}
              >
                <IoBriefcaseOutline className="text-black text-2xl" />
              </motion.div>
              <h3 className="text-2xl font-semibold text-white">Experience</h3>
            </div>

            <div className="space-y-8">
              {experience.map((item, index) => (
                <motion.div
                  key={index}
                  initial={{ opacity: 0, x: -20 }}
                  animate={{ opacity: 1, x: 0 }}
                  transition={{ duration: 0.5, delay: index * 0.1 }}
                  className="relative pl-10 border-l-2 border-orange-400 hover:border-orange-300 transition-colors duration-300"
                >
                  <motion.div
                    className="absolute -left-3 top-0 w-6 h-6 bg-orange-400 rounded-full"
                    whileHover={{ scale: 1.2 }}
                  ></motion.div>
                  <h4 className="text-xl font-semibold text-white mb-2 hover:text-orange-300 transition-colors duration-300">
                    {item.title}
                  </h4>
                  <span className="text-base text-orange-400 mb-2 block font-medium">
                    {item.period}
                  </span>
                  <p className="text-base text-gray-300">{item.description}</p>
                </motion.div>
              ))}
            </div>
          </section>

          {/* Skills Section */}
          <section>
            <h3 className="text-2xl font-semibold text-white mb-8">My Skills</h3>
            <div className="content-card bg-gray-700 p-6 rounded-lg shadow-md">
              <div className="flex flex-wrap gap-4">
                {skills.map((skill, index) => (
                  <motion.div
                    key={index}
                    initial={{ opacity: 0, y: 20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.5, delay: index * 0.05 }}
                    className="skill-item bg-gradient-to-r from-orange-400 to-yellow-500 text-black px-4 py-2 rounded-lg shadow-md hover:shadow-xl hover:scale-105 transition-all duration-300"
                    whileHover={{ y: -5 }}
                  >
                    <span className="text-base font-medium">{skill}</span>
                  </motion.div>
                ))}
              </div>
            </div>
          </section>
        </motion.div>
  );
};

export default Resume;
